import React from 'react';

const Article = article => {
    const {urlToImage, url, title, description, source} = article;

    let image = '';


    return (
        <div className='col-md-6 col-12 mb-4'>
            <div className='card'>
            <div className='card-image'>
            {urlToImage}
            </div>
            </div>
        </div>
    );
};

export default Article;
